  true,\n\t\"url\": null,\n\t\"notes\": \"The Current Population Survey (CPS) is the
  primary source of labor force statistics for the U.S. population.  It is the source
  of numerous high-profile economic statistics, including the national unemployment
  rate, and provides data on a wide range of issues relating to employment and earnings.
  \ The CPS also collects extensive demographic data that complement and enhance our
  understanding of labor market conditions in the nation.  The survey is jointly sponsored
  by the U.S. Census Bureau and the Bureau of Labor Statistics (BLS).\",\n\t\"license_title\":
